import React, { useEffect, useState } from 'react';
import { View, Text, TouchableOpacity, Image } from 'react-native';
import { withRouter } from 'react-router-native';
import styles from './styles/ResultStyle.js';

const Result = (props) => {
  const [result, setResult] = useState('');
  const [scanning, setScanning] = useState(true);

  useEffect(() => {
    if (props.location.state) {
      const { result } = props.location.state;
      setResult(result);

      setTimeout(() => {
        setScanning(false);
      }, 2000);
    }
  }, [props.location.state]);

  const handleBackToShooting = () => {
    const { history } = props;
    history.push('/shooting');
  };

  return (
    <View style={styles.container}>
      <View style={styles.topinfo}>
        <View style={styles.row}>
          <View style={styles.backmenu}>
            <TouchableOpacity style={styles.rectangle} onPress={handleBackToShooting}>
              <Text style={styles.backArrow}>
                <FontAwesome5 name="arrow-left" size={22} />
              </Text>
            </TouchableOpacity>
          </View>
        </View>
        <View style={styles.mainphoto}>
          <View style={styles.content}>
            <View style={styles.elipse2}>
              <View style={styles.elipse}>
                {props.location.state && (
                  <Image source={{ uri: props.location.state.imageUrl }} style={styles.camera} />
                )}
              </View>
            </View>
          </View>
        </View>
      </View>
      <View style={styles.bottominfo}>
        <View style={styles.circleChart}>
          {scanning ? (
            <View style={styles.circleChartPercentage}>
              <View style={styles.content}>
                <Text style={styles.scanningText}>Scanning...</Text>
              </View>
            </View>
          ) : (
            <View style={styles.circleChartPercentage}>
              <Svg style={styles.circleChartBackground} viewBox="0 0 50 50">
                <Circle
                  className={`circle-chart__circle circle-chart__circle--${result}`}
                  cx="25"
                  cy="25"
                  r="24"
                  strokeWidth="2"
                />
              </Svg>
              <View style={styles.content}>
                <Text style={styles.resultText}>{result}</Text>
              </View>
            </View>
          )}
        </View>
      </View>
    </View>
  );
};

export default withRouter(Result);
